import React from 'react'

const ReadOnlyWeapon = ({w,props}) => {
  return (
    <tr >
                <td>{w.id}</td>
                <td>{w.name}</td>
                <td>{w.reach}"</td>
                <td>{w.agility}</td>
                <td>{w.impact}</td>
                <td>{w.cost}</td>
                <td>{w.description}</td>
                
              </tr>
  );
};

export default ReadOnlyWeapon
